 import { color } from "@mui/material/node_modules/@mui/system"
import circle from "../assets/images/Group 243.png"



export const Hero=()=>{
     const style={
         position:'absolute',
         left:1000,
         overflow:'hidden'
     }
    return(
        <>sx={{ overflow: 'hidden' }}
         <div sx={{ overflow: 'hidden' }}>
          <img sx={{ overflow: 'hidden' }} style={style} height={1000} width={1000} src={circle} alt="circle" />
        
         </div>
            
        </>
    )
}
